import { HeaderBox, Login, Logo, Title } from "../style";
import { SearchBox } from "./SearchBox";

export const Header = () => {
  return (
    <HeaderBox>
      <SearchBox></SearchBox>
      <Logo></Logo>
      <Title></Title>
      <Login></Login>
    </HeaderBox>
  );
};
